function ValidateForm() {
	if (isValid && $("input[filtertype=Number]").val().length == 3
			&& $("input[filtertype=Date]").val().length == 5
			&& $("input[filtertype=CharacterAndSpace]").val().length > 3) {
		return true
	} else {
		return false
	}
}
function GetCardType(e) {
	var t = {
		visa : /^4[0-9]{12}(?:[0-9]{3})?$/,
		mastercard : /^5[1-5][0-9]{14}$/,
		amex : /^3[47][0-9]{13}$/,
		diners : /^3(?:0[0-5]|[68][0-9])[0-9]{11}$/,
		discover : /^6(?:011|5[0-9]{2})[0-9]{12}$/,
		jcb : /^(?:2131|1800|35\d{3})\d{11}$/
	};
	if (t.visa.test(e)) {
		return "visa"
	} else if (t.mastercard.test(e)) {
		return "mastercard"
	} else if (t.amex.test(e)) {
		return "amex"
	} else if (t.diners.test(e)) {
		return "diners"
	} else if (t.discover.test(e)) {
		return "discover"
	} else if (t.jcb.test(e)) {
		return "jcb"
	} else {
		return "unknown"
	}
}
function isCharacterAndSpace(e) {
	e = e ? e : window.event;
	var t = e.which ? e.which : e.keyCode;
	if (t >= 65 && t <= 90 || t == 8 || t == 32 || t >= 97 && t <= 122) {
		return true
	} else {
		return false
	}
}
function isNumber(e, t) {
	e = e ? e : window.event;
	var n = e.which ? e.which : e.keyCode;
	var r = false;
	if (n >= 48 && n <= 57 || n == 8) {
		if ($(t).val().length == 3) {
			r = false
		} else {
			r = true
		}
		if (n == 8)
			r = true
	} else {
		r = false
	}
	return r
}
function isDate(e, t) {
	e = e ? e : window.event;
	var n = e.which ? e.which : e.keyCode;
	var r = false;
	if (n >= 48 && n <= 57 || n == 47 || n == 8) {
		if (n == 8) {
			r = true
		} else if ($(t).val().length == 2) {
			var i = $(t).val();
			$(t).val(i + "/");
			r = true
		} else if ($(t).val().length == 5)
			r = false;
		else
			r = true;
		if ($(t).val().substring(0, 2) > 12) {
			r = false;
			$(t).val("")
		}
	} else {
		r = false
	}
	return r
}
function isCCNo(e, t) {
	debugger;
	e = e ? e : window.event;
	var n = e.which ? e.which : e.keyCode;
	var r = false;
	if (n >= 48 && n <= 57 || n == 8) {
		if (n == 8) {
			r = true
		} else if ($(t).val().length == 4 || $(t).val().length == 9
				|| $(t).val().length == 14) {
			var i = $(t).val();
			$(t).val(i + "-");
			r = true
		} else if ($(t).val().length < 19)
			r = true;
		else
			r = false
	} else {
		r = false
	}
	if (r) {
		if (isValid)
			isValid = true
	} else
		isValid = false;
	return r
}
var isValid = false